arrayTemplates['template-artists-professional']=function(){ return "<div class=\"portfoliolayoutcontainer\">\r\n    <div class=\"portfoliotop\">\r\n        <div class=\"portfoliomaintitle\" id=\"portfoliomaintitle\">\r\n            <a href=\"#\" class=\"profilemainnamelink\" id=\"profilemainnamelink<%-con[0].id%>\">\r\n                <span><%-con[0].name%><\/span>\r\n            <\/a>\r\n        <\/div>\r\n        <div class=\"portfoliolayoutmenucontainer\">\r\n            <% for (var i=1; i< con.length;i++){\r\n            var menuelem = con[i];\r\n            var slug = path+'\/'+menuelem.slug;\r\n            var hasSubsections = false;\r\n            var menutype=\"\";\r\n            if ((menuelem.slug == \"portfolio\")||(menuelem.slug==\"videos\")) {\r\n                menutype=\"gallery\";\r\n                if (menuelem.description1 == '2') menutype = \"portfolio_old\";\r\n            }\r\n            if (menuelem.slug == 'profile') menutype=\"profile\";\r\n            if (menuelem.slug == 'press') {\r\n                menutype=\"press_gallery\";\r\n                if (menuelem.description1 == '2') menutype = \"press_old\";\r\n            }\r\n            if (menuelem.slug == 'social') {\r\n                menutype = \"social\";\r\n                slug=menuelem.link;\r\n            }\r\n            if ((menuelem.hasOwnProperty('subsections'))&&(menuelem.subsections.length>0)) hasSubsections = true;\r\n            if (hasSubsections) {\r\n                for (var k=0;k< menuelem.subsections.length;k++) {\r\n                var submenuelem = menuelem.subsections[k];\r\n                var submenutype=\"\";\r\n                if ((menuelem.slug == \"portfolio\")||(menuelem.slug==\"videos\")) {\r\n                submenutype=\"gallery\";\r\n                if (submenuelem.description1 == '2') submenutype = \"portfolio_old\";\r\n                }\r\n                %>\r\n                <a href=\"<%-slug%>\/<%-submenuelem.slug%>\" data-type=\"<%-submenutype%>\" data-slug=\"<%-slug%>\/<%-submenuelem.slug%>\" data-id=\"<%-submenuelem.id%>\" class=\"portfoliomenuitem\" id=\"portfoliomenuitem<%-submenuelem.id%>\"><span><%-submenuelem.name%><\/span><\/a>\r\n                <% }\r\n            } else { %>\r\n            <a href=\"<%-slug%>\" data-slug=\"<%-slug%>\" data-id=\"<%-menuelem.id%>\" data-type=\"<%-menutype%>\" class=\"portfoliomenuitem\" id=\"portfoliomenuitem<%-menuelem.id%>\"><span><%-menuelem.name%><\/span><\/a>\r\n            <% } %>\r\n\r\n            <% } %>\r\n            <% if (more.length>0) {%>\r\n            <img src=\"\/images\/05_portfolio_menu_line.png\" class=\"menuseparator\"\/>\r\n            <a href=\"#\" class=\"seemoreprofessionals\" id=\"seemoreprofessionals\">see more <%-type%><\/a>\r\n\r\n            <% } %>\r\n\r\n\r\n            <img src=\"\/images\/05_portfolio_menu_line.png\" class=\"menuseparator showonfd\" style=\"margin-left:0px;\"\/>\r\n            <a href=\"javascript:history.go(-1)\" class=\"seemoreprofessionals showonfd\" id=\"backbutton\" >back<\/a>\r\n            <\/div>\r\n    <\/div>\r\n\r\n    <div class=\"portfoliosectincontainer\" id=\"portfoliosectincontainer\">\r\n        <\/div>\r\n<\/div>\r\n<div class=\"seemoreprofessionalsoverlay\"><\/div>\r\n\r\n<% if (more.length>0) {%>\r\n<div class=\"seemoreprofessionalscontainer\">\r\n    <% for (var i=0; i< more.length;i++){\r\n    var elemMore = more[i];\r\n    %>\r\n    <div class=\"otherprofessional\">\r\n        <a href=\"\/<%-elemMore.path%>\/<%-elemMore.slug%>\" class=\"otherprofessionallink\"><%-elemMore.name%><\/a>\r\n    <\/div>\r\n    <% } %>\r\n<\/div>\r\n<% } %>"};
