arrayTemplates['template-models-search']=function(){ return "<div class=\"searchmodelsleft\">\r\n    <input type=\"text\" value=\"\" placeholder=\"name\" id=\"searchname\" class=\"searchinput\"\/>\r\n\r\n    <% for (var i=0;i< criteriaoptions.length;i++) {\r\n        var option = criteriaoptions[i];\r\n        var optionsAr = criteria[option];\r\n    %>\r\n    <ul class=\"searchdropdown\">\r\n        <li>\r\n            <a href=\"#\" class=\"mainsearchlink\" data-criteria=\"<%-option%>\" data-selectedvalue=\"\" id=\"mainsearch<%-option%>\"><%-option%><\/a>\r\n            <ul>\r\n            <% for (var j=0; j < optionsAr.length;j++) { %>\r\n                <li><a href=\"#\" class=\"searchdropdownoption\" data-parentid=\"mainsearch<%-option%>\"><%-optionsAr[j]%><\/a><\/li>\r\n                <% } %>\r\n            <\/ul>\r\n        <\/li>\r\n    <\/ul>\r\n    <% } %>\r\n\r\n    <\/div>\r\n\r\n<div class=\"searchmodelsright\">\r\n    <\/div>"};
arrayTemplates['template-models-searchList']=function(){ return "<% for (var i=0; i< models.length;i++){\r\nvar modelelem = models[i];\r\nvar slug = modelelem.slug;\r\n%>\r\n<div class=\"modellistcontainer\">\r\n    <div class=\"containermodelimagewrap\">\r\n    <div class=\"containermodelimage\">\r\n        <img src=\"<%-modelelem.imagepath%>\" class=\"modelimage\" data-id=\"<%modelelem.id%>\" data-slug=\"<%-slug%>\" \/>\r\n    <\/div>\r\n        <\/div>\r\n    <div class=\"containermodelname\">\r\n        <a href=\"<%-slug%>\" class=\"modellink\" data-id=\"<%modelelem.id%>\" data-slug=\"<%-slug%>\"><span><%-modelelem.name%><\/span><\/a>\r\n    <\/div>\r\n<\/div>\r\n<% } %>"};
arrayTemplates['template-pages-becomeamodel']=function(){ return "<div class=\"modelpagemaintitle\" id=\"modelpagemaintitle\">\r\n    <a href=\"\/\" class=\"profilemainnamelink\" id=\"becomeamodeltitle\">\r\n        <span>become a model<\/span>\r\n    <\/a>\r\n<\/div>\r\n<div id=\"becomeamodelcontent\">\r\n    <%=content%>\r\n<\/div>\r\n\r\n<input id=\"fileupload\" type=\"file\" name=\"files\" data-url=\"\/becomemodel\/uploadfile\" >"};
arrayTemplates['template-pages-contact']=function(){ return "\r\n<div class=\"modelpagemaintitle\" id=\"modelpagemaintitle\">\r\n    <a href=\"\/\" class=\"profilemainnamelink contactmainlink\" id=\"contacttitle\">\r\n        <span>contact<\/span>\r\n    <\/a>\r\n<\/div>\r\n<div id=\"contactcontent\">\r\n\r\n    <% if (content.firsttext!=''){ %>\r\n    <div class=\"contactfirsttext\">\r\n        <%=content.firsttext%>\r\n        <\/div>\r\n    <% } %>\r\n    <div class=\"contacttextscontainer\">\r\n        <% for (var i=0;i< content.texts.length;i++){\r\n            if (content.texts[i]=='') continue;\r\n        %>\r\n        <div class=\"contacttextwrapper\">\r\n            <%=content.texts[i]%>\r\n        <\/div>\r\n        <% } %>\r\n        <\/div>\r\n\r\n    <div class=\"facebooklikecontainer\" id=\"facebooklikecontainer\">\r\n    <div class=\"fb-like\" data-href=\"http:\/\/ studiogroup.com\/\" data-layout=\"button_count\" data-action=\"like\" data-show-faces=\"false\" data-share=\"false\"><\/div>\r\n        <\/div>\r\n<\/div>"};
arrayTemplates['template-pages-international']=function(){ return "<div class=\"modelpagemaintitle\" id=\"modelpagemaintitle\">\r\n    <a href=\"\/\" class=\"profilemainnamelink\" id=\"internationaltitle\">\r\n        <span>international<\/span>\r\n    <\/a>\r\n<\/div>\r\n<div id=\"internationalcontent\">\r\n    <% for (var i=0; i< content.length;i++){\r\n    var modelelem = content[i];\r\n    var slug = modelelem.link;\r\n    %>\r\n    <div class=\"modellistcontainer modellistcontainerinternational\">\r\n        <div class=\"containermodelimagewrap\">\r\n        <div class=\"containermodelimage\">\r\n            <img src=\"<%-modelelem.imagepath%>\" class=\"modelimage\" data-id=\"<%modelelem.id%>\" data-slug=\"<%-slug%>\" \/>\r\n        <\/div>\r\n            <\/div>\r\n        <div class=\"containermodelnameinternational\">\r\n            <span><%=modelelem.name%><\/span>\r\n            <div class=\"containermodelnameinternationallist\">\r\n                <%=modelelem.list%>\r\n                <\/div>\r\n        <\/div>\r\n    <\/div>\r\n    <% } %>\r\n<\/div>"};
arrayTemplates['template-pages-specialoccasion']=function(){ return "<div class=\"modelpagemaintitle\" id=\"modelpagemaintitle\">\r\n    <a href=\"\/\" class=\"profilemainnamelink specialoccasionmainlink\" id=\"specialoccasiontitle\">\r\n        <span>special occasion<\/span>\r\n    <\/a>\r\n<\/div>\r\n<div class=\"specialoccasiontext\"><%=text%><\/div>\r\n<div id=\"specialoccasioncontent\">\r\n    <% for (var i=0; i< content.length;i++){\r\n    var modelelem = content[i];\r\n    var slug = modelelem.link;\r\n    %>\r\n    <div class=\"modellistcontainer\">\r\n        <div class=\"containermodelimagewrap\">\r\n        <div class=\"containermodelimage\">\r\n            <img src=\"<%-modelelem.imagepath%>\" class=\"modelimage\" data-id=\"<%modelelem.id%>\" data-slug=\"<%-slug%>\" \/>\r\n        <\/div>\r\n            <\/div>\r\n        <div class=\"containermodelname\">\r\n            <a href=\"<%-slug%>\" class=\"modellink\" data-id=\"<%modelelem.id%>\" data-slug=\"<%-slug%>\"><span><%-modelelem.name%><\/span><\/a>\r\n        <\/div>\r\n    <\/div>\r\n    <% } %>\r\n<\/div>"};